    <style>
      @import url('https://fonts.googleapis.com/css2?family=Orbitron:wght@400;500;600&display=swap');
      #vis.vega-embed{
          max-width: 1200px;
          margin: 0 auto;
      }
      .vega-bindings {
          display: flex;
          flex-direction: row;
          justify-content: center;
          align-items: center;
          gap: 2rem;
          padding: 1rem;
          background: linear-gradient(45deg, #1a1a3d, #2a2a4d);
          border-radius: 10px;
          box-shadow: 0 4px 6px rgba(0, 0, 0, 0.3);
      }
      .vega-embed.has-actions {
          padding-right: 0px !important;
      }
      #vis.vega-embed details, #vis.vega-embed details summary {
            position: relative;
            left: -20px;
            top: 5px;
      }
      .vega-bind {
          display: flex;
          align-items: center;
          gap: 1rem; /* 调整选择器文本与选择框之间的距离 */
      }
      
      .vega-bind-name {
          color: #FFD700;
          font-family: 'Orbitron', sans-serif;
          font-size: 14px;
          text-shadow: 0 0 5px rgba(255, 215, 0, 0.3);
      }
      
      .vega-bind select {
          background-color: #2a2a4d;
          color: #EAEAEA;
          border: 1px solid #9370DB;
          border-radius: 5px;
          padding: 5px 10px;
          font-family: 'Orbitron', sans-serif;
          cursor: pointer;
          transition: all 0.3s ease;
      }
      
      .vega-bind select:hover {
          background-color: #3a3a5d;
          border-color: #FFD700;
          box-shadow: 0 0 10px rgba(255, 215, 0, 0.2);
      }
      
      .vega-bind select:focus {
          outline: none;
          border-color: #FFD700;
          box-shadow: 0 0 15px rgba(255, 215, 0, 0.3);
      }
    </style>
